import axios from 'axios';
import Audio from './Audio';

class Music extends React.Component{

    state = {
        audiofiles : []
    }

    async componentDidMount() {
        console.log('mounted');
        const response = await axios.get('/top', { 
            baseURL : 'https://api.napster.com/v2.1/tracks',
            params : {
                apikey : 'ZTk2YjY4MjMtMDAzYy00MTg4LWE2MjYtZDIzNjJmMmM0YTdm',
            }
        });
        console.log(response);
        this.setState({audiofiles : response.data.tracks}, () => {
            console.log(this.state.audiofiles);
        })
    }

    displayAudioFiles = () =>{
        this.state.audiofiles.map((audio) => {
            return <Audio />
        });
    }

    render(){
        if(this.state.audiofiles.length > 0)
        return(
            <div> {this.displayAudioFiles()}</div>
        );
        return(
            <div>Loading.</div>
        )
    }
}

export default Music;
